import React from 'react';

class DrRegister extends React.Component
{

    render()
    {
        return(
            <form>
                <h3>Sign Up for Physicians</h3>

                <div className="form-group">
                    <label>Username </label>
                    <input type="text" className="form-control" placeholder="Enter Username" />
                </div>

                <div className="form-group">
                    <label>Password </label>
                    <input type="password" className="form-control" placeholder="Enter Password" />
                </div>

                <div className="form-group">
                    <label>Fullname </label>
                    <input type="text" className="form-control" placeholder="Enter Fullname" />
                </div>

                <div className="form-group">
                    <label>NPI </label>
                    <input type="text" className="form-control" placeholder="Enter NPI" />
                </div>

                

                <button type="submit" className="btn btn-primary btn-block">Sign Up</button>

            </form>
        );
    }

};

export default DrRegister;
